  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:42.315896\",\n\t\"name\": \"bird-communities-and-white-spruce-succession-on-the-kenai-peninsula-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Chugach National Forest's habitat management
  program to create winter range for moose is compatible with non-game bird management.
  Areas burned for moose will provide habitat for a wide variety of birds that are
  unable to use mature forests, and they will provide diversity in forest age and
  type in the future. However, some species will be adversely affected by the burning
  program, so attention must be given to maintaining habitat for these species. Attention
  to maximizing the value of prescribed burn sites to birds will insure that the burns
  are useful to some species of woodpeckers that now occur only in low numbers on
  the Kenai.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
